INSERT INTO public._pages_v_blocks_story_block (_order, _parent_id, _path, id, pre_heading, heading, sub_heading, media_type, media_id, svg_code, lottie_j_s_o_n, layout, background_color, media_border_radius, media_width, content_width, _uuid, block_name) VALUES (1, 119, 'version.layout', 360, '', 'How It Works', 'We understand employers need a solution that''s both impactful and effortless. Earn Mwachangu delivers on both fronts:', 'image', NULL, NULL, NULL, 'center', 'brand-dark-green', 'rounded-3xl', 'md:w-1/2', 'md:w-1/2', '67f1e066f500b500043cee77', NULL);
INSERT INTO public._pages_v_blocks_story_block (_order, _parent_id, _path, id, pre_heading, heading, sub_heading, media_type, media_id, svg_code, lottie_j_s_o_n, layout, background_color, media_border_radius, media_width, content_width, _uuid, block_name) VALUES (1, 62, 'version.layout', 10, 'Our Story', 'A Vision for Financial Freedom in Malawi', 'Earn Mwachangu was born in early 2022, conceived by visionary founders Manilla PeppleTheophilus and Chisomo Gracious Kajamu. Witnessing the devastating impact of katapila unlicensed loan institutions charging exorbitant interest rates of up to 50% we saw apressing need for a better solution. Employees, often desperate for quick cash, would fall into a vicious cycle of debt, risking their hard-earned properties used as collateral.  In addition to katapila, we noticed that formal banks and microfinance institutions, despiteoffering lower interest rates and flexible repayment schedules, were not meeting the urgentneeds of people in financial distress. Their lengthy paperwork and slow loan disbursementprocesses often made them an unviable option for those facing unexpected financialemergencies. People needed a faster, more accessible solution.Determined to change this narrative, we began building a platform in July 2022 to offeremployees in Malawi interest-free access to their earned wages, providing a safer and more sustainable alternative. On November 9, 2023, Earn Mwachangu was officially registered as a limited company in Malawi, ready to empower the masses with financial independence andsecurity.', 'image', NULL, NULL, NULL, 'center', 'white', 'rounded-3xl', 'md:w-1/2', 'md:w-1/2', '67f1cb9e22e124666c617cf6', NULL);
INSERT INTO public._pages_v_blocks_story_block (_order, _parent_id, _path, id, pre_heading, heading, sub_heading, media_type, media_id, svg_code, lottie_j_s_o_n, layout, background_color, media_border_radius, media_width, content_width, _uuid, block_name) VALUES (1, 120, 'version.layout', 361, '', 'How It Works', 'We understand employers need a solution that''s both impactful and effortless. Earn Mwachangu delivers on both fronts:', 'image', NULL, NULL, NULL, 'center', 'brand-dark-green', 'rounded-3xl', 'md:w-1/2', 'md:w-1/2', '67f1e066f500b500043cee77', NULL);
