INSERT INTO public.pages_blocks_story_block (_order, _parent_id, _path, id, pre_heading, heading, sub_heading, media_type, media_id, svg_code, lottie_j_s_o_n, layout, background_color, media_border_radius, media_width, content_width, block_name) VALUES (1, 2, 'layout', '67f1cb9e22e124666c617cf6', 'Our Story', 'A Vision for Financial Freedom in Malawi', 'Earn Mwachangu was born in early 2022, conceived by visionary founders Manilla PeppleTheophilus and Chisomo Gracious Kajamu. Witnessing the devastating impact of katapila unlicensed loan institutions charging exorbitant interest rates of up to 50% we saw apressing need for a better solution. Employees, often desperate for quick cash, would fall into a vicious cycle of debt, risking their hard-earned properties used as collateral.  In addition to katapila, we noticed that formal banks and microfinance institutions, despiteoffering lower interest rates and flexible repayment schedules, were not meeting the urgentneeds of people in financial distress. Their lengthy paperwork and slow loan disbursementprocesses often made them an unviable option for those facing unexpected financialemergencies. People needed a faster, more accessible solution.Determined to change this narrative, we began building a platform in July 2022 to offeremployees in Malawi interest-free access to their earned wages, providing a safer and more sustainable alternative. On November 9, 2023, Earn Mwachangu was officially registered as a limited company in Malawi, ready to empower the masses with financial independence andsecurity.', 'image', NULL, NULL, NULL, 'center', 'white', 'rounded-3xl', 'md:w-1/2', 'md:w-1/2', NULL);
INSERT INTO public.pages_blocks_story_block (_order, _parent_id, _path, id, pre_heading, heading, sub_heading, media_type, media_id, svg_code, lottie_j_s_o_n, layout, background_color, media_border_radius, media_width, content_width, block_name) VALUES (2, 2, 'layout', '67f1d48673477361581c33df', '', 'Vision', 'To pioneer an inclusive, transparent, and user-driven financial landscape. Through innovative solutions, we aim to empower users, fortify economic resilience, and push the boundaries of financial accessibility and innovation in Malawi.', 'image', NULL, NULL, NULL, 'imageLeft', 'white', 'rounded-3xl', 'md:w-1/2', 'md:w-1/2', NULL);
INSERT INTO public.pages_blocks_story_block (_order, _parent_id, _path, id, pre_heading, heading, sub_heading, media_type, media_id, svg_code, lottie_j_s_o_n, layout, background_color, media_border_radius, media_width, content_width, block_name) VALUES (3, 2, 'layout', '67f1dc12214cfa92c33405d9', '', 'Mission', 'To revolutionize financial wellness by providing seamless, interest-free access to earned wages. We aim to eliminate the cycle of predatory debt, promote financial independence, and foster stronger employer-employee relationships. Through cutting-edge technology and a customer-centric approach, we strive to create a sustainable financial ecosystem that empowers individuals and drives economic growth in Malawi.', 'image', NULL, NULL, NULL, 'imageRight', 'white', 'rounded-3xl', 'md:w-1/2', 'md:w-1/2', NULL);
